  return(
    <div>
      <h3>{props.year}</h3>
    </div>
  );
}
let Songs = [
  {
    No: 1,
    title: '"Corale"',
    length: '2:05'
  },
  {
    No: 2,
    title: '"Time Lapse"',
    length: '5:32'
  },
  ];
  function SongsList(props) {
    return (
      <div>
        <h4>Songs:</h4>
      </div>
    );

  }
export default App;
